    return(

    <ul className="list-group">

        <SocialItem 
            p = {{
                media: 'Facebook',
                id: 'facebook',
                img: 'https://picsum.photos/60',

            }}

        />
        <SocialItem 

            p = {{
                media: 'Youtube',
                id : 'youtube',
                img: 'https://picsum.photos/61',

            }}

             
        />
        <SocialItem

            p = {{
                media: 'Instagram',
                id : 'instagram',
                img: 'https://picsum.photos/62',

            }}
        />


        <SocialItem
            media ='LinkedIn'
            id ='linkedIn'
            img='https://picsum.photos/63'
        />

    </ul>
    );
}

export default Social;
